import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Link
} from "react-router-dom";

function Header() {
  return (
    <div className="header">
      <h1>Bank Hero</h1>
      <ul>
        <li>
          <a to="/public">Public Page</a>
        </li>
        <li>
          <a to="/protected">Protected Page</a>
        </li>
      </ul>

    </div>
  );
}

export default Header;
